import { createMuiTheme } from "material-ui/styles";
import indigo from "material-ui/styles/colors/indigo";
import pink from "material-ui/styles/colors/pink";
import red from "material-ui/styles/colors/red";

export default createMuiTheme({
  palette: {
    primary: pink,
    secondary: indigo // Indigo is probably a good match with pink
  }
});
